import React, { Component } from 'react';
import icon from '../img/logo.png';
import Navitem from './Navitem';

class Navbar extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            
            <nav className="navbar navbar-expand-lg bg-dark navbar-dark bg-dark sticky-top">
                <a className="navbar-brand" href="./index.html">
                    <img id="logo" src={icon} width={150} alt="Logo"></img>
                </a>
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav mr-auto">
                        <li className="nav-item dropdown">
                            <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                                Idioma
                            </a>
                            <div className="dropdown-menu" aria-labelledby="navbarDropdown">
                                <a class="dropdown-item" href="#">Català</a>
                                <a class="dropdown-item" href="#">Castellà</a>
                                <a class="dropdown-item" href="#">Anglès</a>
                            </div>
                        </li>
                    </ul>
                    <form class="form-inline my-2 my-lg-0">
                        <input type="submit" className="btn btn-danger" value="Inicia Sessió" onClick />
                    </form>
                </div>
            </nav>
        )
    }
}

export default Navbar;
